import React from 'react'

import btn_options from '../assets/btn_options.png'
import './master.css'


export default props => {

    return (
        <div className="Header">
            <ul>
              <li><a id="title">React</a></li>
              <li><img className="btn_options" src={btn_options} /></li>
            </ul>
        </div>
    )

}
